rga alcanvel: 0,2L/min - aproximada (50 cmH2O); O reanimador deve possuir capacidade de funcionamento correto tanto em condies climticas comuns, quanto sob temperaturas extremas (adequadas  realidade climtica do Brasil); Temperatura de armazenamento de -5C a 70C. Da Vlvula: Deve conter vlvula que impea o retorno do fluxo do ar exalado pelo paciente para o balo do ressuscitador; Deve possuir vlvula tipo Pop-Off com limite de presso ajustvel. Quando necessrio, permite regulagem ou bloqueio da vlvula limitadora de presso em 40 cmH2O - 60 cmH2O; Sistema de vlvula com obturador nico que melhora a visibilidade e o manuseio do fluxo de ar ao paciente; O conector dever permitir o giro da mscara em 360, nos dois sentidos; Conector expiratrio (para a vlvula PEEP acoplada): 30mm MACHO (ISO). Espao morto: menor que 7ml; Resistncia inspiratria: (com ou sem o tubo de depsito de oxignio) 50L/min aproximada -3,8 cmH2O e a 5L/min aproximada -0,8 cmH2O. Resistncia expiratria: 50L/min aproximado: 4,5 cmH2O e a 5L/min aproximada 0,6 cmH2O; Sistema de limitao de presso: da elasticidade da bolsa que limita a presso das vias respiratrias em aproximadamente (80cmH2O) numa compresso normal; Conector do paciente: 22/15mm (universal - ISO). Mxima presso de descarga alcanvel quando a vlvula limitadora de presso  anulada: de aproximadamente 100cmH2O; abertura do limitador de presso da vlvula com mximo de 45 cmH2O. Caso haja excesso de presso, a elasticidade da tampa externa deve limitar a presso de ar ao mximo de 4,8Kpa (48 cmH2O). Do Reservatrio: O sistema de reservatrio deve assegurar a otimizao do oxignio utilizado, de forma a permitir o fornecimento de altas concentraes de oxignio ao paciente; Reservatrio de oxignio tipo bolsa com volume mnimo de 1000ml; Resistncia inspiratria da bolsa do reservatrio de oxignio: a 50L/min aproximado: -1,0 cmH2O a 5L/min; Autoclavvel entre 121 a 134 C. Da Mscara: A mscara deve ser feita em polisulfona transparente, para permitir a deteco de regurgitao, ciano